import { Button, Table,Select, Space  } from 'antd';
import axios from 'axios';
import { useEffect, useState } from 'react';
import url from '../components/host';
import { AiOutlineCheck, AiOutlineClose } from "react-icons/ai";
import "./style/style.css"



const Tables = () => {
  const [setSelectedRowKeys] = useState([]);
  const [setLoading] = useState(false);
  const [data, setdata] = useState([])
  const [data1, setdata1] = useState([])
  const [data2, setdata2] = useState([])
  const [data3, setdata3] = useState([])
  const [data4, setdata4] = useState([])
  const [data5, setdata5] = useState([])
  const [data6, setdata6] = useState([])
  const [page, setPage] = useState(1)



  const columns = [
    {
      title: 'Id',
      dataIndex: 'id',
    },
    {
      title: 'Name',
      dataIndex: 'name',
    },
    {
      title: 'Price',
      dataIndex: 'price',
    },
    {
      title: 'Status',
      dataIndex: 'is_active',
      render: (el) => <div  >{el ? (<h1 style={{ color: "green" }}><AiOutlineCheck /></h1>) : (<h1 style={{ color: "red" }} ><AiOutlineClose /></h1>)}</div>


    },
    {
      title: "Ma'lumot",
      key: "edit",
      width: "5%",
      render: (__, item) => {
        return <div><Button onClick={() => { getOneProduct(item) }} style={{ background: 'orange', color: 'white' }} type="text">Ma'lumot</Button></div>
      }
    },
    {
      title: "Edit",
      key: "edit",
      width: "5%",
      render: () => {
        return <div><Button style={{ background: 'orange', color: 'white' }} type="danger">O'zgartirish</Button></div>
      }
    },
    {
      title: "Delete",
      key: "delete",
      width: "5%",
      render: () => {
        return <div>
          <Button onClick={() => daleteAxiox(data.id)} type="danger">O'chirish</Button>
        </div>

      }
    },
  ];

  const getOneProduct = (item) => {
    setdata(item)
    setPage(2)
    console.log(item);

  }

  function getData() {
    axios.get(`${url}/api/cars/`).then(res => {
      setdata1(res.data)
    })
  }
  useEffect(() => {
    getData()
  }, [])

  function getFuel() {
    axios.get(`${url}/api/fuel_sort/`).then(res => {
      setdata2(res.data)
    })
  }
  useEffect(() => {
    getFuel()
  }, [])

  function getGear() {
    axios.get(`${url}/api/gear_box/`).then(res => {
      setdata3(res.data)
    })
  }
  useEffect(() => {
    getGear()
  }, [])

  function getGar() {
    axios.get(`${url}/api/garant/`).then(res => {
      setdata4(res.data)
    })
  }
  useEffect(() => {
    getGar()
  }, [])

  function getPosit() {
    axios.get(`${url}/api/position/`).then(res => {
      setdata6(res.data)
    })
  }
  useEffect(() => {
    getPosit()
  }, [])

  function getBranch() {
    axios.get(`${url}/api/branch/`).then(res => {
      setdata5(res.data)
    })
  }
  useEffect(() => {
    getBranch()
  }, [])



  function daleteAxiox(key) {
    axios.delete(`${url}/api/cars/${key}/`, { headers: { 'Authorization': 'Bearer ' + sessionStorage.getItem("token") } }).then(res => {
      alert("ishladi")
      window.location.reload()
    }).catch(err => {
      alert("ishlamadi")
    })
  }

  function postoyna() {
    document.querySelector(".postoyna").style = "position:fixed;right:0px;  transition: 1s;"
    document.querySelector("body").style = "background: rgba(0, 0, 0, 0.5);"
  }
  function postoynaa() {
    document.querySelector(".postoyna").style = "position:fixed;right:-100%;  transition: 1s;"
  }

  function getPost() {
    var formdata = new FormData()
    formdata.append("position",document.querySelector("#poz").value)
    formdata.append("fuel_sort",document.querySelector("#yoq").value)
    formdata.append("gearbox",document.querySelector("#vit").value)
    formdata.append("garant",document.querySelector("#gar").value)
    formdata.append("branch",document.querySelector("#fil").value)
    formdata.append("year",document.querySelector(".yil").value)
    formdata.append("distance",document.querySelector(".mas").value)
    formdata.append("engine",document.querySelector(".dvi").value)
    formdata.append("",document.querySelector(".vaqt").value)
    formdata.append("",document.querySelector(".vaqt").value)
    formdata.append("",document.querySelector(".vaqt").value)
    formdata.append("",document.querySelector(".vaqt").value)

    axios.post(`${url}/api/cars/`, formdata, { headers: { 'Authorization': 'Bearer ' + sessionStorage.getItem("token") } }).then(res => {
      alert("ishladimoqda")
      window.location.reload()
    }).catch(err => {
      alert("ishlamadi")
      console.log(err);
    })
  }

  const start = () => {
    setLoading(true);
    // ajax request after empty completing
    setTimeout(() => {
      setSelectedRowKeys([]);
      setLoading(false);
    }, 100);
  };






  return (
    <div>
      {page == 1 ? (<div><Button onClick={() => postoyna()} className='qoshish' type="primary">Qo'shish</Button><Table className='table' columns={columns} dataSource={data1} /></div>) : (
        <div>
          <div className="nomi1">
            <h1 className='nomi'>{data.name}</h1>
            <Button onClick={() => (setPage(1))} type="danger">Orqaga</Button>
          </div>
          <div className="alltext">
            <div className="alltext2">
